import React from 'react';

function Test({prevSection}) {

    const goBack = (e) => {
        e.prevetDefault();
        prevSection();
    }

    return (
        <div className="m-4">
            <button className="btn btn-primary" onClick={goBack}>Go Back</button>
        </div>
    )
}

export default Test;
